{"$type":"Vanrise.Entities.VRNamespaceItemSettings, Vanrise.Entities","Code":{"$type":"Vanrise.Common.MainExtensions.VRDynamicCode.CustomCodeDynamicCodeSettings, Vanrise.Common.MainExtensions","ConfigId":"bdd289df-573c-44a1-9a95-d0de2ed9dd71","CustomCode":"public class RatePlanManager
{
	public CalculateRatePlanServicesPricingOutput CalculateRatePlanServicesPricing(CalculateRatePlanServicesPricingInput input)
	{
		var genericBEManager = new Vanrise.GenericData.Business.GenericBusinessEntityManager();

		var filterGroup = new Vanrise.GenericData.Entities.RecordFilterGroup { Filters = new List<Vanrise.GenericData.Entities.RecordFilter>() };
		filterGroup.Filters.Add(new Vanrise.GenericData.Entities.ObjectListRecordFilter 
		{
			FieldName = "RatePlan",
			Values = new List<Object> { input.RatePlanId },
			CompareOperator = Vanrise.GenericData.Entities.ListRecordFilterOperator.In
		});

		var neededColumns = new List<string> { "Service", "ActivationFee", "RecurringFee", "SuspensionCharge", "Deposit", "BankGuarantee", "AdvancedPaymentNbBillingCycles" };
		var servicesEntities = genericBEManager.GetAllGenericBusinessEntities(new Guid("435bba40-1865-413c-9af3-21c0555d9cef"), neededColumns, filterGroup);

		var output = new CalculateRatePlanServicesPricingOutput();

		if(servicesEntities != null)
		{
			foreach(var serviceEntity in servicesEntities)
			{
				if(input.ServiceIds.Contains(new Guid(serviceEntity.FieldValues["Service"].ToString())))
				{
					output.TotalActivationFee += CalculateCharge(serviceEntity, "ActivationFee");
					output.TotalRecurringFee += CalculateCharge(serviceEntity, "RecurringFee");
					output.TotalSuspensionFee += CalculateCharge(serviceEntity, "SuspensionCharge");
					output.TotalDeposit += CalculateCharge(serviceEntity, "Deposit");
					output.TotalBankGuarantee += CalculateCharge(serviceEntity, "BankGuarantee");
					var advancedPaymentNbBillingCyclesAsObj = serviceEntity.FieldValues["AdvancedPaymentNbBillingCycles"];
					if(advancedPaymentNbBillingCyclesAsObj != null)
					{
						int advancedPaymentNbBillingCycles = (int)advancedPaymentNbBillingCyclesAsObj;
						if(advancedPaymentNbBillingCycles > 0)
						{
							output.TotalPaymentInAdvance += advancedPaymentNbBillingCycles * CalculateCharge(serviceEntity, "RecurringFee");
						}
					}
				}
			}
		}		

		return output;
	}

	Decimal CalculateCharge(Vanrise.GenericData.Entities.GenericBusinessEntity serviceEntity, string chargeFieldName)
	{
		var charge = serviceEntity.FieldValues[chargeFieldName];				
		if(charge != null)
		{
			var chargeValue = charge.CastWithValidate<Retail.BusinessEntity.Entities.RetailBEChargeEntity>("charge")?.Settings?.CalculateCharge(null);
			if(chargeValue.HasValue)
				return chargeValue.Value;
		}	
		return 0;
	}
}

